import { Fragment } from "react";
import Numpad from "./Numpad";
import Operation from "./Operation";

function Calculator() {


    return (
        <Fragment>
            <div className="container">
                <div className="row">
                    <Operation />
                </div>
                <Numpad />
                <Numpad />
                <Numpad />
                <Numpad />
                <Numpad />
                <Numpad />
                <Numpad />
                <Numpad />
                <Numpad />
            </div>
        </Fragment>
    );
}

export default Calculator;
